Este soneto humorístico fue escrito por Manuel del Palacio (1831-1906), poeta, periodista y satírico español del Realismo. Fue un autor conocido por sus composiciones de tono festivo y satírico, como se puede apreciar en este poema que termina con un giro humorístico inesperado.
